package com.bsth.si.util;

public class SelectJson {
	private String text;
	private String id;
	
	public SelectJson() {
		// TODO Auto-generated constructor stub
	}

	public SelectJson(String text, String id) {
		// TODO Auto-generated constructor stub
		this.text = text;
		this.id = id;
	}

	public String getText() {
		return text;
	}

	public void setText(String text) {
		this.text = text;
	}

	public String getId() {
		return id;
	}

	public void setId(String id) {
		this.id = id;
	}

}
